/**
 * ui 체크 관련
 * Created by 임영주 on 2016-10-04.
 */
var FILTER = FILTER || {};

/**
 * 공백 제거
 * chkName : 체크 태그의 id 또는 class
 */
FILTER.removeWhitespace = function (chkName) {
    $(chkName).keyup(function () {
        $(this).val($(this).val().replace(/[ ]/g, ''));
    }).blur(function () {
        $(this).val($(this).val().replace(/[ ]/g, ''));
    });
};
/**
 * 특수부호 제거(현재 상품명 중복체크시 사용)
 */
FILTER.chkSpecialCharacter = function (obj) {
    var re = /[;\'\"\^`\\]/gi; //정규식 구문
    obj.val(jQuery.trim(obj.val().replace(re, "")));
    return obj.val();
};
/**
 * 한글, 영문, 숫자만 체크
 * @param sValue
 * @returns {*}
 */
FILTER.checkRegularExpression = function (sValue) {
    var regexp = /[~!@\#$%<>^&*\()\-_=+\,.?;:'"`|{}\/\[\]\\\u3400-\u9FBF\u3040-\u309F]/gi;
    return sValue.match(regexp);
};
/**
 * 따옴표 체크
 * @param sValue
 * @returns {*}
 */
FILTER.checkDoubleQuote = function (sValue) {
    var regexp = /["]/gi;
    return sValue.match(regexp);
};

/**
 * 숫자만 입력가능
 * (Tab, Enter, Delete키 입력 가능하도록수정 (2013.01.30 wms04))
 * clickName : 체크 태그의 id 또는 class
 */
FILTER.chkNumber = function (chkName) {
    $(chkName).keydown(function (e) {

        var keyCode = e.which;

        // Tab, Enter, Delete키 포함
        var isNumberPress = ((keyCode >= 48 && keyCode <= 57) // 숫자키
            || (keyCode >= 96 && keyCode <= 105) // 키패드
            || keyCode == 8 // BackSpace
            || keyCode == 9 // Tab
            || keyCode == 46
            || keyCode == 13);
        // Delete && enter
        if (!isNumberPress) {
            e.preventDefault();
        }
    }).keyup(function () {
            $(this).val($(this).val().replace(/[^0-9]/g, ''));
        }
    ).blur(function () {
            $(this).val($(this).val().replace(/[^0-9]/g, ''));
        }
    );
};

/**
 *  영문, 숫자, 특수문자만 허용
 *
 */
FILTER.restrictedEngNumSpec = function (chkName) {

    $(chkName).keyup(function () {
        $(this).val($(this).val().replace(/[^~!@#$%^&*()_+|<>?:{}0-9a-zA-Z\-\.\_]/g, ''));
    });

    $(chkName).blur(function () {
        $(this).val($(this).val().replace(/[^~!@#$%^&*()_+|<>?:{}0-9a-zA-Z\-\.\_]/g, ''));
    });
};

/**
 * 비밀번호 유효성 체크
 */
FILTER.chkPassword = function (chkName, checkMsgName) {

    var oPass = $(chkName);
    var bResult = true;

    if (oPass != null && oPass != undefined) {
        var sPass = oPass.val();
        var len = sPass.length;

        //1. 영문, 숫자, 특수기호 외 문자가 존재하는지 검사
        var regexp = /[^0-9a-zA-Z~!@#$%^&*()_+|<>?:{}]/;
        if (regexp.test(sPass) === true) { return false; }

        //2. 비밀번호 길이 검사
        if (len < 8 || len > 16) { return false; }

        //3. 조합 검사
        var regNum = /[0-9]/g;
        var regEng = /[a-zA-Z]/gi;
        var regSpec = /[~!@#$%^&*()_+|<>?:{}]/gi;

        var bExistNum = sPass.search(regNum) > -1;
        var bExistEng = sPass.search(regEng) > -1;
        var bExistSpec = sPass.search(regSpec) > -1;

        if (len > 9) {   //10글자 이상인 경우 - 2가지 조합
            if (bExistNum === true && bExistEng === false && bExistSpec === false) { bResult = false; }
            if (bExistNum === false && bExistEng === true && bExistSpec === false) { bResult = false; }
            if (bExistNum === false && bExistEng === false && bExistSpec === true) { bResult = false; }
            //            console.log('길이 10 이상 2가지 조합여부 : ' + bResult);
        } else if (len > 7) {  //8글자 이상인 경우 - 3가지 조합
            bResult = !(bExistNum === false || bExistEng === false || bExistSpec === false);
            //            console.log('길이 8 이상 3가지 조합여부 : ' + bResult);
        }

        if (bResult === false) {
            oPass.focus();
            return false;
        }
    }
    return true;
};

FILTER.chkNumberSize = function (chkName, digit, bReplace) {
    $('body').delegate(chkName, 'keydown', function (e) {
        var keyCode = e.which;
        // Tab, Enter, Delete키 포함
        var isNumberPress = ((keyCode >= 48 && keyCode <= 57) // 숫자키
            || (keyCode >= 96 && keyCode <= 105) // 키패드
            || keyCode == 8 // BackSpace
            || keyCode == 9 // Tab
            || keyCode == 46
            || keyCode == 13
            || keyCode == 190 // 키보드 마침표.
            || keyCode == 110 // 키패드 마침표(.)
        );

        if (digit > 0) {
            if ((keyCode == 190 || keyCode == 110) && $(this).val().indexOf('.') > -1) {
                e.preventDefault();
                return false;
            }
        }
        // Delete && enter
        if (!isNumberPress) {
            e.preventDefault();
            return false;
        }
    }).delegate(chkName, 'keyup', function (e) {
        if (digit > 0) {
            var val = $(this).val().split('.');
            if (val.length > 1) {
                $(this).val($(this).val().substring(0, $(this).val().indexOf('.') + 1 + digit));
            }
        }
        //if (bReplace === false) return false;
        $(this).val($(this).val().replace(/[^-.0-9]/g, ''));
    }).delegate(chkName, 'blur', function (e) {
        if (digit > 0) {
            var val = $(this).val().split('.');
            if (val.length > 1) {
                $(this).val($(this).val().substring(0, $(this).val().indexOf('.') + 1 + digit));
            }
        }
        //if (bReplace === false) return false;
        $(this).val($(this).val().replace(/[^-.0-9]/g, ''));
    });
};

