FILTER.setNumberFormat = function (num) {
    if (isNaN(num) === true) {
        return num;
    }

    // int -> string
    var str = num + '';
    var Re = /[^0-9]/g;
    var ReN = /(-?[0-9]+)([0-9]{3})/;
    str = str.replace(Re, '');

    while (ReN.test(str)) {
        str = str.replace(ReN, '$1,$2');
    }

    return str;
};

FILTER.setDecimalNumberFormat = function (num, digit) {
    // decimal -> string
    var str = num + '';

    var val = str.split('.');
    if (val.length > 1) {
        str = str.substring(0, str.indexOf('.') + 1 + digit);
    }

    var Re = /[^0-9.]/g;
    var ReN = /(-?[0-9]+)([0-9]{3})/;
    str = str.replace(Re, '');

    while (ReN.test(str)) {
        str = str.replace(ReN, '$1,$2');
    }

    return str;
};

FILTER.removeComma = function (num) {
    return (num.replace(/\,/g, ""));
};

FILTER.chkTextareaByte = function (sTextareaId, sByteDisplyId, maxByte) {
    var str = $(sTextareaId).val();
    var str_len = str.length;

    var rbyte = 0;
    var rlen = 0;
    var one_char = "";
    var str2 = "";

    for (var i = 0; i < str_len; i++) {
        one_char = str.charAt(i);

        if (escape(one_char).length > 4) {
            rbyte += 2;
        } else {
            rbyte++;
        }

        if (rbyte <= maxByte) {
            rlen = i + 1;
        }
    }

    if (rbyte > maxByte) {
        str2 = str.substr(0, rlen);
        $(sTextareaId).val(str2);
        FILTER.chkTextareaByte(sTextareaId, sByteDisplyId, maxByte);
    } else {
        $(sByteDisplyId).html(rbyte);
    }
};

/**
 * 로케일 정보
 * @author djkang
 * @since 2020-04-09
 **/
(function () {
    var $i18n_price = {
        /**
         * 세션에 담긴 로케일 정보
         */
        _locale: 'en_US',
        _setLocale: function () {
//            if (__session_locale !== '') {
//                $i18n_price._locale = __session_locale;
//            }

            $i18n_price._locale = $i18n_price._getCookie('bakan_locale') || 'ko_KR';
        },
        _getCookie: function (sName) {
            var sResult = '';
            if (document.cookie.length > 0) {
                var iPosStart = document.cookie.indexOf(sName + '=');
                if (iPosStart != -1) {
                    iPosStart = iPosStart + sName.length + 1;
                    var iPosEnd = document.cookie.indexOf(';', iPosStart);
                    if (iPosEnd == -1) {
                        iPosEnd = document.cookie.length;
                    }
                    sResult = unescape(document.cookie.substring(iPosStart, iPosEnd));
                }
            }

            return sResult;
        },
        /**
         *  Local별 환율적용 가격
         *
         * @param iPrice
         * @param bApplyRate
         * @returns {string}
         * @private
         */
        _price: function (iPrice, bApplyRate) {
            switch ($i18n_price._locale) {
                case 'en_US':
                    let iExchangeRate = bApplyRate === 'T' ? 0.001 : 1;
                    iPrice = FILTER.setDecimalNumberFormat(iPrice * iExchangeRate, 2);
                    return '$ ' + iPrice;
                    break;
                case 'ko_KR':
                    return FILTER.setNumberFormat(parseInt(iPrice)) + '원';
                    break;
                default:
                    return FILTER.setNumberFormat(parseInt(iPrice)) + '원';
            }
        },
        _init: function () {
            $i18n_price._setLocale();

            window['__price'] = function (mPrice, bApplyRate) {
                let iPrice = parseFloat(new String(mPrice).replace(/[^0-9.]/, ''));
                return $i18n_price._price(iPrice, (bApplyRate || 'T'));
            };
        }
    };

    $i18n_price._init();
})();

