    // 스토리지 key value 생성
    function set(key, value) {
        key = key || '';
        // JSON 객체담기
        value = value && (value.constructor === Object || value.constructor === Array) ? JSON.stringify(value) : value;

        this.storage.setItem(key, value);
        this.length = this.storage.length;

        return this;
    };

