/**
 * AJAX 표준 함수
 *
 * @param options
 */
SHOP.ajax = function (options) {
    $options = $.extend({
        type: 'post',
        async: true,
        dataType: 'json',
        headers: {
            'X-CSRF-TOKEN': LocalStorage.get('csrf-token', 'ses')
        },
        beforeSend: function () {
            if (options.loading != undefined || options.loading === true) {
                $('.ui-load').show();
            }
        },
        success: function () {

        },
        error: function (response) {
            if (response['responseText'] != '') {
                var result = jQuery.parseJSON(response['responseText']);
                SHOP.showLayerAlert({
                    sContents: result.message.replace(/\\n/g, '\n'),
                    oCallback: function () {
                        //location.reload();
                    }
                });
            }
        },
        complete: function () {
            if (options.loading != undefined || options.loading === true) {
                $(".ui-load").hide();

                delete options.loading;
            }
        }
    }, options);

    return $.ajax($options);
};

