/**
 * 계산 금액 가져오기
 */
SHOP.AMOUNT = {
    iVatRate: 10,

    /**
     * 부가세
     *
     * @param iOrderAmount
     * @returns {number}
     */
    getVat: function (iOrderAmount) {
        // 부가세율(%)
        var iVatAmount = iOrderAmount * SHOP.AMOUNT.iVatRate / 100;

        // 자리수 계산 ( ex, 123.567 -> 123 )
        var iPosition = Math.pow(10, 0);

        // 소수점 첫째자리에서 반올림
        return parseInt(Math.round(iVatAmount / iPosition) * iPosition);
    },

    /**
     * 서비스 수수료
     *
     * @param iOrderAmount
     * @param dCommissionRate
     * @returns {number}
     */
    getCommission: function (iOrderAmount, dCommissionRate) {
        // 부가세
        var iVatAmount = SHOP.AMOUNT.getVat(iOrderAmount);

        // 서비스 수수료 금액
        var iCommissionAmount = (iOrderAmount + iVatAmount) * dCommissionRate / 100;

        // 자리수 계산 ( ex, 1,204.6 -> 1,205 )
        var iPosition = Math.pow(10, 0);

        // 소수점 첫째자리에서 반올림
        return parseInt(Math.round(iCommissionAmount / iPosition) * iPosition);
    },

    /**
     * 결제 금액
     *
     * @param iOrderAmount
     * @param dCommissionRate
     * @param iShippingPrice
     * @returns {*}
     */
    getPayAmount: function (iOrderAmount, dCommissionRate, iShippingPrice) {
        return parseInt(iOrderAmount + SHOP.AMOUNT.getVat(iOrderAmount) + SHOP.AMOUNT.getCommission(iOrderAmount, dCommissionRate) + iShippingPrice);
    },
};

