/**
 * null 체크 후 null이면 대체 Text
 *
 * @param sVal
 * @param sReplaceVal
 * @returns {*}
 */
SHOP.nvl2 = function (sVal, sReplaceVal) {
    if (sVal != null && sVal != "" && (typeof sVal != "undefined")) {
        if ((typeof sVal.valueOf() == "string" && sVal.length > 0) || (typeof sVal.valueOf() == "number") || (typeof sVal.valueOf() == 'object')) {
            return sVal;
        } else {
            return sReplaceVal;
        }
    } else {
        sVal = (sVal == null || sVal == '' || (typeof sVal == "undefined")) ? sReplaceVal : sVal;
        return sVal;
    }
};

/**
 * 옵션 표기
 *
 * @param sOption1
 * @param sOption2
 * @returns {string}
 */
SHOP.setConcatOption = function (sOption1, sOption2) {
    var sOption = '-';

    if ((SHOP.nvl2(sOption1, '') != '') && !(SHOP.nvl2(sOption2, '') != '')) {
        // 옵션1만 있는 경우
        sOption = sOption1;
    } else if (!(SHOP.nvl2(sOption1, '') != '') && (SHOP.nvl2(sOption2, '') != '')) {
        // 옵션2만 있는 경우
        sOption = sOption2;
    } else if ((SHOP.nvl2(sOption1, '') != '') && (SHOP.nvl2(sOption2, '') != '')) {
        // 옵션1,2 둘 다 있는 경우
        sOption = sOption1 + ' ' + '/' + ' ' + sOption2;
    }

    return sOption;
};

/**
 * escape 처리
 * @param mVal
 * @returns {string|*}
 */
SHOP.setRemoveXss = function (mVal) {
    if (mVal === '' || mVal === null || mVal === undefined) {
        return mVal;
    }

    var oEscape = {
        '&': '&amp;',
        '<': '&lt;',
        '>': '&gt;',
        '"': '&quot;',
        "'": '&#039;'
    };

    // string
    if (typeof (mVal) === 'string') {
        mVal = mVal.replace(/[&<>"']/g, function (m) {
            return oEscape[m];
        });
    }

    // object
    if (typeof (mVal) === 'object') {
        for (var key in mVal) {
            if (typeof (mVal) === 'object') {
                mVal[key] = SHOP.setRemoveXss(mVal[key]);
            } else {
                mVal[key] = mVal[key].replace(/[&<>"']/g, function (m) {
                    return oEscape[m];
                });
            }
        }
    }

    return mVal;
}

