var SignIn = {
    act: function () {
        if (this.check() === false) {
            return false;
        }

        var bActiveLogin = ($('#chkActiveLogin').is(':checked') === true) ? 'T' : 'F';

        SHOP.ajax({
            headers: {
                'X-CSRF-TOKEN': LocalStorage.get('csrf-token', 'ses')
            },
            url: '/sign/action/signedIn',
            data: {
                'user_id': $('#txtSignInUserId').val(),
                'user_password': $('#txtSignInUserPassword').val(),
                'active_login': bActiveLogin
            },
            success: function () {
                location.href = '/';
                //location.reload();
            }
        });
    },

    check: function () {
        if ($('#txtSignInUserId').val() == '' || $('#txtSignInUserId').val() == undefined) {
            SHOP.showLayerAlert({
                sContents: '아이디를 입력해 주세요.',
                oCallback: function () {
                    $('#txtSignInUserId').focus();
                }
            });

            return false;
        }

        if ($('#txtSignInUserPassword').val() == '' || $('#txtSignInUserPassword').val() == undefined) {
            SHOP.showLayerAlert({
                sContents: '비밀번호를 입력해 주세요.',
                oCallback: function () {
                    $('#txtSignInUserPassword').focus();
                }
            });
            return false;
        }
    },

    /**
     * 아이디 찾기
     */
    getFindId: function () {
        if (SignIn.checkFindId() === false) {
            return false;
        }

        SHOP.ajax({
            url: '/sign/action/findedId',
            data: $('#frmFindId').serialize(),
            success: function (res) {
                SignIn.closeLayer();
                if (res.result === true) {
                    $('#layer_finded_id .eUserEmail').text(res.data.user_email);
                    $('#layer_finded_id .eUserRegistDate').text(res.data.user_regist_date);
                    $('button[data-target="#layer_finded_id"]').trigger('OPEN');
                } else {
                    SHOP.showLayerAlert({
                        sContents: res.message,
                        oCallback: function () {
                            $('.openLayerFindId').click();
                        }
                    });
                    // $('#layer_error .error_msg').text(res.message);
                    // $('button[data-target="#layer_error"]').trigger('OPEN');
                }

                $('#layer_find_id input[name="shop_name"]').next('a').click();
                $('#layer_find_id input[name="business_cell1"]').val('010');
                $('#layer_find_id .ui-select button').text('010');
                $('#layer_find_id input[name="business_cell2"]').next('a').click();
                $('#layer_find_id input[name="business_cell3"]').next('a').click();
            }
        });
    },

    /**
     * 아이디 찾기
     * @returns {boolean}
     */
    checkFindId: function () {
        if ($('#layer_find_id input[name="shop_name"]').val() == '') {
            SHOP.showLayerAlert({sContents: '담당자 이름을 입력해주세요.'});
            $('#layer_find_id input[name="shop_name"]').focus();
            return false;
        }

        var bCheckCell = true;
        $('#layer_find_id input[name^="business_cell"]').each(function () {
            if ($(this).val() == '') {
                SHOP.showLayerAlert({sContents: '담당자 휴대폰 번호를 입력해주세요.'});
                $(this).focus();
                bCheckCell = false;
                return false;
            }
        });
        if (bCheckCell === false) {
            return false;
        }
    },

    /**
     * 비밀번호 찾기
     * @returns {boolean}
     */
    getFindPasswd: function () {
        if (SignIn.checkFindPasswd() === false) {
            return false;
        }

        SHOP.ajax({
            url: '/sign/action/findedpasswd',
            data: $('#frmFindPasswd').serialize(),
            success: function (res) {
                SignIn.closeLayer();
                if (res.result === true) {
                    $('#layer_finded_passwd .eUserName').text(res.data.shop_name);
                    $('#layer_finded_passwd .eUserEmail').text(res.data.user_email);

                    $('button[data-target="#layer_finded_passwd"]').trigger('OPEN');
                } else {
                    SHOP.showLayerAlert({
                        sContents: res.message,
                        oCallback: function () {
                            $('.openLayerFindPasswd').click();
                        }
                    });
                }

                $('#layer_find_passwd input[name="shop_name"]').next('a').click();
                $('#layer_find_passwd input[name="user_id"]').next('a').click();
                $('#layer_find_passwd input[name="email"]').val('naver.com');
                $('#layer_find_passwd .ui-select button').text('네이버');
                $('#layer_find_passwd input[name="email_direct"]').hide().next('a').click();
            }
        });
    },

    checkFindPasswd: function () {
        if ($('#layer_find_passwd input[name="shop_name"]').val() == '') {
            SHOP.showLayerAlert({sContents: '담당자 이름을 입력해주세요.'});
            $('#layer_find_passwd input[name="shop_name"]').focus();
            return false;
        }

        if ($('#layer_find_passwd input[name="user_id"]').val() == '') {
            SHOP.showLayerAlert({sContents: '아이디를 입력해주세요.'});
            $('#layer_find_passwd input[name="user_id"]').focus();
            return false;
        }

        if ($('#layer_find_passwd input[name="email_direct"]').attr('disabled') == undefined && $('#layer_find_passwd input[name="email_direct"]').val() == '') {
            SHOP.showLayerAlert({sContents: '이메일을 입력해주세요.'});
            $('#layer_find_passwd input[name="email_direct"]').focus();
            return false;
        }
    },

    closeLayer: function () {
        $('#layer_find_id').trigger('CLOSE');
        $('#layer_finded_id').trigger('CLOSE');
        $('#layer_find_passwd').trigger('CLOSE');
        $('#layer_finded_passwd').trigger('CLOSE');
    }
};

/**
 * ui 체크 관련
 * Created by 임영주 on 2016-10-04.
 */
var FILTER = FILTER || {};

/**
 * 공백 제거
 * chkName : 체크 태그의 id 또는 class
 */
FILTER.removeWhitespace = function (chkName) {
    $(chkName).keyup(function () {
        $(this).val($(this).val().replace(/[ ]/g, ''));
    }).blur(function () {
        $(this).val($(this).val().replace(/[ ]/g, ''));
    });
};
/**
 * 특수부호 제거(현재 상품명 중복체크시 사용)
 */
FILTER.chkSpecialCharacter = function (obj) {
    var re = /[;\'\"\^`\\]/gi; //정규식 구문
    obj.val(jQuery.trim(obj.val().replace(re, "")));
    return obj.val();
};
/**
 * 한글, 영문, 숫자만 체크
 * @param sValue
 * @returns {*}
 */
FILTER.checkRegularExpression = function (sValue) {
    var regexp = /[~!@\#$%<>^&*\()\-_=+\,.?;:'"`|{}\/\[\]\\\u3400-\u9FBF\u3040-\u309F]/gi;
    return sValue.match(regexp);
};
/**
 * 따옴표 체크
 * @param sValue
 * @returns {*}
 */
FILTER.checkDoubleQuote = function (sValue) {
    var regexp = /["]/gi;
    return sValue.match(regexp);
};

/**
 * 숫자만 입력가능
 * (Tab, Enter, Delete키 입력 가능하도록수정 (2013.01.30 wms04))
 * clickName : 체크 태그의 id 또는 class
 */
FILTER.chkNumber = function (chkName) {

    $(chkName).keydown(function (e) {

        var keyCode = e.which;

        // Tab, Enter, Delete키 포함
        var isNumberPress = ((keyCode >= 48 && keyCode <= 57) // 숫자키
            || (keyCode >= 96 && keyCode <= 105) // 키패드
            || keyCode == 8 // BackSpace
            || keyCode == 9 // Tab
            || keyCode == 46
            || keyCode == 13);
        // Delete && enter
        if (!isNumberPress) {
            e.preventDefault();
        }
    }).keyup(function () {
            $(this).val($(this).val().replace(/[^0-9]/g, ''));
        }
    ).blur(function () {
            $(this).val($(this).val().replace(/[^0-9]/g, ''));
        }
    );
};

