FILTER.chkNumberSize = function (chkName, digit, bReplace) {
    $('body').delegate(chkName, 'keydown', function (e) {
        var keyCode = e.which;
        // Tab, Enter, Delete키 포함
        var isNumberPress = ((keyCode >= 48 && keyCode <= 57) // 숫자키
            || (keyCode >= 96 && keyCode <= 105) // 키패드
            || keyCode == 8 // BackSpace
            || keyCode == 9 // Tab
            || keyCode == 46
            || keyCode == 13
            || keyCode == 190 // 키보드 마침표.
            || keyCode == 110 // 키패드 마침표(.)
        );

        if (digit > 0) {
            if ((keyCode == 190 || keyCode == 110) && $(this).val().indexOf('.') > -1) {
                e.preventDefault();
                return false;
            }
        }
        // Delete && enter
        if (!isNumberPress) {
            e.preventDefault();
            return false;
        }
    }).delegate(chkName, 'keyup', function (e) {
        if (digit > 0) {
            var val = $(this).val().split('.');
            if (val.length > 1) {
                $(this).val($(this).val().substring(0, $(this).val().indexOf('.') + 1 + digit));
            }
        }
        //if (bReplace === false) return false;
        $(this).val($(this).val().replace(/[^-.0-9]/g, ''));
    }).delegate(chkName, 'blur', function (e) {
        if (digit > 0) {
            var val = $(this).val().split('.');
            if (val.length > 1) {
                $(this).val($(this).val().substring(0, $(this).val().indexOf('.') + 1 + digit));
            }
        }
        //if (bReplace === false) return false;
        $(this).val($(this).val().replace(/[^-.0-9]/g, ''));
    });
};

