/**
 * 비밀번호 유효성 체크
 */
FILTER.chkPassword = function (chkName, checkMsgName) {

    var oPass = $(chkName);
    var bResult = true;

    if (oPass != null && oPass != undefined) {
        var sPass = oPass.val();
        var len = sPass.length;

        //1. 영문, 숫자, 특수기호 외 문자가 존재하는지 검사
        var regexp = /[^0-9a-zA-Z~!@#$%^&*()_+|<>?:{}]/;
        if (regexp.test(sPass) === true) {
            return false;
        }

        //2. 비밀번호 길이 검사
        if (len < 8 || len > 16) {
            return false;
        }

        //3. 조합 검사
        var regNum = /[0-9]/g;
        var regEng = /[a-zA-Z]/gi;
        var regSpec = /[~!@#$%^&*()_+|<>?:{}]/gi;

        var bExistNum = sPass.search(regNum) > -1;
        var bExistEng = sPass.search(regEng) > -1;
        var bExistSpec = sPass.search(regSpec) > -1;

        if (len > 9) {   //10글자 이상인 경우 - 2가지 조합
            if (bExistNum === true && bExistEng === false && bExistSpec === false) {
                bResult = false;
            }
            if (bExistNum === false && bExistEng === true && bExistSpec === false) {
                bResult = false;
            }
            if (bExistNum === false && bExistEng === false && bExistSpec === true) {
                bResult = false;
            }

        } else if (len > 7) {  //8글자 이상인 경우 - 3가지 조합
            bResult = !(bExistNum === false || bExistEng === false || bExistSpec === false);
        }

        if (bResult === false) {
            oPass.focus();
            return false;
        }
    }
    return true;
};

FILTER.setNumberFormat = function (num) {
    if (isNaN(num) === true) {
        return num;
    }

    // int -> string
    var str = num + '';
    var Re = /[^0-9]/g;
    var ReN = /(-?[0-9]+)([0-9]{3})/;
    str = str.replace(Re, '');

    while (ReN.test(str)) {
        str = str.replace(ReN, '$1,$2');
    }

    return str;
};

FILTER.setComma = function (num) {
    if (isNaN(num) === true) {
        return num;
    }

    // int -> string
    var str = num + '';
    var Re = /[^-0-9]/g;
    var ReN = /(-?[0-9]+)([0-9]{3})/;
    str = str.replace(Re, '');

    while (ReN.test(str)) {
        str = str.replace(ReN, '$1,$2');
    }

    return str;
};

FILTER.setDecimalNumberFormat = function (num, digit) {
    // decimal -> string
    var str = num + '';

    var val = str.split('.');
    if (val.length > 1) {
        str = str.substring(0, str.indexOf('.') + 1 + digit);
    }

    var Re = /[^0-9.]/g;
    var ReN = /(-?[0-9]+)([0-9]{3})/;
    str = str.replace(Re, '');

    while (ReN.test(str)) {
        str = str.replace(ReN, '$1,$2');
    }

    return str;
};

FILTER.removeComma = function (num) {
    return (num.replace(/\,/g, ""));
};

FILTER.chkTextareaByte = function (sTextareaId, sByteDisplyId, maxByte) {
    var str = $(sTextareaId).val();
    var str_len = str.length;

    var rbyte = 0;
    var rlen = 0;
    var one_char = "";
    var str2 = "";

    for (var i = 0; i < str_len; i++) {
        one_char = str.charAt(i);

        if (escape(one_char).length > 4) {
            rbyte += 2;
        } else {
            rbyte++;
        }

        if (rbyte <= maxByte) {
            rlen = i + 1;
        }
    }

    if (rbyte > maxByte) {
        str2 = str.substr(0, rlen);
        $(sTextareaId).val(str2);
        FILTER.chkTextareaByte(sTextareaId, sByteDisplyId, maxByte);
    } else {
        $(sByteDisplyId).html(rbyte);
    }
};

/**
 * null 체크 후 null이면 대체 Text
 *
 * @param sVal
 * @param sReplaceVal
 * @returns {*}
 */
FILTER.nvl2 = function (sVal, sReplaceVal) {
    if (sVal != null && sVal != "" && (typeof sVal != "undefined")) {
        if ((typeof sVal.valueOf() == "string" && sVal.length > 0) || (typeof sVal.valueOf() == "number") || (typeof sVal.valueOf() == 'object')) {
            return sVal;
        } else {
            return sReplaceVal;
        }
    } else {
        sVal = (sVal == null || sVal == '' || (typeof sVal == "undefined")) ? sReplaceVal : sVal;
        return sVal;
    }
};

/**
 * Input컴포넌트의 data-filter 속성의 값만 허용
 */
FILTER.applyInputFilter = function () {
    // 특수문자는 정규표현식 안에서 \'이 되게해야 해서 \를 3개 붙여야함.
    var oRegexpMap = {
        kor: 'ㄱ-ㅎㅏ-ㅣ가-힣',
        eng: 'a-zA-Z',
        num: '0-9',
        special: '~!@#$%^&*()_+|<>?:{}\\\-\\\=\\\`\\\\\\\[\\\]\\\;\\\'\\\"\\\,\\\.\\\/',
        space: ' ',
        special_all: '~!@#$%^&*()_+|<>?:{}\\\-\\\=\\\`\\\\\\\[\\\]\\\;\\\'\\\"\\\,\\\.\\\/\\\r\\\n ', // 특문 + 공백 + 엔터
        decimal: '0-9\\\.',
        jp: 'ぁ-ゔァ-ヴー々〆〤',
        cn: '一-龥',
    };

    $('body').on('input blur', 'input[data-filter], textarea[data-filter]', function () {
        var oInput = $(this);
        var sFilterRegexp = oInput.data('filter_regexp') == undefined ? '' : oInput.data('filter_regexp');
        var sFilter = oInput.data('filter') == undefined ? '' : oInput.data('filter');

        // this의 data에 정규표현식 저장 (입력마다 체크때문)
        if (sFilterRegexp == '') {
            sFilter.split('|').forEach(function (sFilter) {
                if (oRegexpMap[sFilter] != undefined) {
                    sFilterRegexp += oRegexpMap[sFilter];
                }
            });

            oInput.data('filter_regexp', sFilterRegexp);
        }

        // 정규표현식에 맞지 않으면 문자 제거
        var sRegexp = new RegExp('[^' + sFilterRegexp + ']', 'g');
        oInput.val(oInput.val().replace(sRegexp, ''));
    });
};

