$(document).ready(function () {
    /**
     * 닫기
     * @param obj
     */
    $('.btn_close').click(function (e) {
        e.preventDefault();
        window.close();
    });
    EXCEL_FORM_MODIFY.init();
});

var EXCEL_FORM_MODIFY = {
    /**
     * 기본 설정
     */
    init: function () {
        EXCEL_FORM_MODIFY.btnEvent();
        EXCEL_FORM_MODIFY.uiEvent('#tbodyExcelSaveArea');
        EXCEL_FORM_MODIFY.uiEvent('#tbodyExcelReConfirmSaveArea');
    },

    /**
     * 활성화된 탭의 tbody id 찾기
     *
     * @param sTabLink
     * @returns {{sAllAreaTBodyId: string, sSaveAreaTbodyId: string}}
     */
    getObjTBodyIdByActiveTabLink: function () {

        var sTabLink = $('.tab-nav .active').find('a').attr('href');

        // 기본양식
        var sExcelAreaBodyId = '#tbodyExcelDefaultArea';
        var sExcelSaveAreaBodyId = '#tbodyExcelSaveArea';

        // 재확인 요청양식
        if (sTabLink == '#tab-con2') {
            sExcelAreaBodyId = '#tbodyExcelReConfirmArea'; // 전체 항목 영역 id
            sExcelSaveAreaBodyId = '#tbodyExcelReConfirmSaveArea'; // 사용 항목 영역 id
        }

        return {'sAllAreaTBodyId': sExcelAreaBodyId, 'sSaveAreaTbodyId': sExcelSaveAreaBodyId};
    },

    /**
     * 버튼 정의
     */
    btnEvent: function () {

        /**
         * 탭 클릭시
         */
        $('#btnTab1, #btnTab2').click(function (e) {
            e.preventDefault();

            var tab_id = $(this).attr('id');
            if (tab_id == 'btnTab1') {
                $('input[name="tab_no"]').val('2'); // data-active-idx는 2가 기본양식탭 1이 재확인요청탭
            } else {
                $('input[name="tab_no"]').val('1');
            }
        });

        /**
         * reset 클릭 시
         */
        $('.btnReset').click(function (e) {
            e.preventDefault();

            var iMenuNo = $('input[name="menu_no"]').val();
            var tab_no = $('input[name="tab_no"]').val();
            var sUrl = '/buyer/excel/front/formModify?menu_no=' + iMenuNo + '&tab_no=' + tab_no;

            location.href = sUrl;
        });

        /**
         * 맨위로 버튼
         * @param obj
         */
        $('.btnFormFirst').click(function (e) {
            e.preventDefault();

            var sSaveAreaTbodyId = EXCEL_FORM_MODIFY.getObjTBodyIdByActiveTabLink()['sSaveAreaTbodyId'];
            var oRow = $(sSaveAreaTbodyId).find('.select-color');
            $(sSaveAreaTbodyId + ' tr:first').before(oRow);
        });
        /**
         * 위로 버튼
         * @param obj
         */
        $('.btnFormPrev').click(function (e) {
            e.preventDefault();

            var sSaveAreaTbodyId = EXCEL_FORM_MODIFY.getObjTBodyIdByActiveTabLink()['sSaveAreaTbodyId'];
            var oRow = $(sSaveAreaTbodyId).find('.select-color');
            oRow.prev().before(oRow);
        });
        /**
         * 아래로 버튼
         * @param obj
         */
        $('.btnFormNext').click(function (e) {
            e.preventDefault();
            var sSaveAreaTbodyId = EXCEL_FORM_MODIFY.getObjTBodyIdByActiveTabLink()['sSaveAreaTbodyId'];
            var oRow = $(sSaveAreaTbodyId).find('.select-color');
            oRow.next().after(oRow);
        });
        /**
         * 맨 아래로
         * @param obj
         */
        $('.btnFormLast').click(function (e) {
            e.preventDefault();

            var sSaveAreaTbodyId = EXCEL_FORM_MODIFY.getObjTBodyIdByActiveTabLink()['sSaveAreaTbodyId'];
            var oRow = $(sSaveAreaTbodyId).find('.select-color');
            $(sSaveAreaTbodyId + ' tr:last').after(oRow);
        });
        /**
         * 스위치 클릭
         */
        $('body').delegate('.eIsUse', 'click', function (e) {
            e.preventDefault();

            if ($(this).hasClass('no_change') == false) {
                EXCEL_FORM_MODIFY.setSwitchBtn(this);
            }
        });
        /**
         * 모든 항목 사용
         * @param obj
         */
        $('.btnAllUse, .btnReConfirmAllUse').click(function (e) {
            e.preventDefault();

            var objTbodyId = EXCEL_FORM_MODIFY.getObjTBodyIdByActiveTabLink();
            EXCEL_FORM_MODIFY.setAllUse(objTbodyId);
        });

        $('.btnNotUse, .btnReConfirmNotUse').click(function (e) {
            e.preventDefault();

            var objTbodyId = EXCEL_FORM_MODIFY.getObjTBodyIdByActiveTabLink();
            EXCEL_FORM_MODIFY.setNotUse(objTbodyId);
        });

        /**
         * 픽업 순서 설정
         */
        $('#btnExcelSave').click(function (e) {
            e.preventDefault();
            EXCEL_FORM_MODIFY.excelFormSubmit();
        });
    },
    /**
     * UI 이벤트
     */
    uiEvent: function (sSaveAreaTbodyId) {

        $(document).on("click", sSaveAreaTbodyId + " tr", function () {
            var selected = $(this).hasClass("select-color");
            $(sSaveAreaTbodyId + " tr").removeClass("select-color");
            if (selected != true) {
                $(this).addClass("select-color");
                $(this).css("background-color", "");
            }
        }).on('mouseenter', sSaveAreaTbodyId + " tr", function () {
            var selected = $(this).hasClass("select-color");
            if (selected != true) {
                $(this).css("background-color", "#f5f5f5");
            }
        }).on('mouseleave', sSaveAreaTbodyId + " tr", function () {
            var selected = $(this).hasClass("select-color");
            if (selected != true) {
                $(this).css("background-color", "");
            }
        });
    },
    /**
     * todo closet  = parent , 태그 아이디,클래스 도 카멜로 , 네임은 필드명 ( DB 컬럼네임 )
     *
     * 스위치 눌렀을때 이벤트
     * @param obj
     */
    setSwitchBtn: function (obj) {
        var oTr = $(obj).closest('tr');
        var sColid = oTr.data('col_id');
        var sColName = oTr.data('col_name');
        var sColFillclass = oTr.data('fill_class');
        var bMatched = false;
        var sAllAreaTBodyId = $(obj).closest('tbody').attr('id'); // 전체 항목 영역
        // 사용 항목 영역
        var sSaveAreaTbodyId = sAllAreaTBodyId == 'tbodyExcelDefaultArea' ? '#tbodyExcelSaveArea' : '#tbodyExcelReConfirmSaveArea';
        var sInputName = sSaveAreaTbodyId == '#tbodyExcelSaveArea' ? 'excel_form[]' : 'excel_re_confirm_form[]';

        $(sSaveAreaTbodyId + ' tr').each(function () {
            if ($(this).data('col_id') == sColid) {
                $(this).remove();
                bMatched = true;
                return false;
            }
        });

        if (bMatched == false) {
            var sHtml = '';
            sHtml += '<tr data-col_id="' + sColid + '">';
            sHtml += '<input type="hidden"  name="' + sInputName + '" value="' + sColid + '">';
            sHtml += '<td><sapn class="' + sColFillclass + '">' + sColName + '</sapn></td></tr>';
            $(sHtml).prependTo($(sSaveAreaTbodyId));
            //$('#tbodyExcelSaveArea').prepend(sHtml);
        }

    },
    setAllUse: function (objTabId) {
        var sAllAreaTBodyId = objTabId['sAllAreaTBodyId'];
        var sSaveAreaTbodyId = objTabId['sSaveAreaTbodyId'];

        var sInputName = sSaveAreaTbodyId == '#tbodyExcelSaveArea' ? 'excel_form[]' : 'excel_re_confirm_form[]';

        var oInput = $(sAllAreaTBodyId).find('span.switch').find('input');
        oInput.attr('checked', 'checked');
        $(sAllAreaTBodyId).find('span.on').addClass('active');
        $(sAllAreaTBodyId).find('span.off').removeClass('active');

        var sHtml = '';
        $(sAllAreaTBodyId + ' tr').each(function () {
            var sColid = $(this).data('col_id');
            var sColName = $(this).data('col_name');
            var sColFillclass = $(this).data('fill_class');
            sHtml += '<tr data-col_id="' + sColid + '">';
            sHtml += '<input type="hidden"  name="' + sInputName + '" value="' + sColid + '">';
            sHtml += '<td><sapn class="' + sColFillclass + '">' + sColName + '</sapn></td></tr>';
        });
        $(sSaveAreaTbodyId).html(sHtml);
    },

    setNotUse: function (objTabId) {
        var sAllAreaTBodyId = objTabId['sAllAreaTBodyId'];

        var oInput = $(sAllAreaTBodyId).find('span.switch').find('input');

        $(sAllAreaTBodyId).find('.eIsUse').each(function () {
            if ($(this).find('.slider > span:first').hasClass('active')) {
                $(this).trigger('click');
            }
        })
    },

    excelFormSubmit: function () {
        var params = $('#frmExcelSave').serialize();
        params += '&' + $('#frmExcelReConfirmSave').serialize();

        SHOP.ajax({
            url: '/buyer/excel/action/excelFormregistered',
            data: params,
            loading: true,
            success: function (res) {
                if (res.result === true) {
                    SHOP.showLayerAlert({
                        sContents: '엑셀 항목 설정이 저장되었습니다.',
                        oCallback: function () {
                            window.opener.location.reload();
                            self.close();
                        }
                    });
                }
            }
        });
    }
}
